import { Box, AppBar, Toolbar, styled, Typography, InputBase, Badge, Avatar, Menu, MenuItem } from '@mui/material'
import React from 'react'
import { Mail, Pets, Notifications } from '@mui/icons-material'

const StyledToolbar = styled(Toolbar)(
    {
        display: "flex",
        justifyContent: "space-between",

    }
)

const Search = styled("div")(
    ({ theme }) => ({
        backgroundColor: "white",
        padding: "0 10px",
        borderRadius: theme.shape.borderRadius,
        width: "40%",
    })
)

const Icons = styled(Box)(
    ({ theme }) => ({
        display: "none",
        gap: "20px",
        [theme.breakpoints.up("sm")]: {
            display: "flex"
        },
        alignItems: "center"
    })
)

const UserBox = styled(Box)(
    ({ theme }) => ({
        display: "flex",
        gap: "10px",

        alignItems: "center",
        [theme.breakpoints.up("sm")]: {
            display: "none"
        },
    })
)


const Navbar = () => {
    const [open, setOpen] = useState(false)

    return (
        <AppBar position="sticky">
            <StyledToolbar>
                <Typography variant="h6" sx={{ display: { xs: "none", sm: "block" } }}>LAMA DEV</Typography>
                <Pets sx={{ display: { xs: "block", sm: "block" } }}></Pets>
                <Search> <InputBase placeholder='search...' /> </Search>
                <Icons>
                    <Badge badgeContent={4} color="error">
                        <Mail />
                    </Badge>
                    <Badge badgeContent={4} color="error">
                        <Notifications />
                    </Badge>
                    <Avatar sx={{ width: "30", height: "30" }}
                        src="data:image/png;base64,"></Avatar>

                </Icons>
                <UserBox>
                    <Avatar sx={{ width: "30", height: "30" }} onClick={e => setOpen(true)}
                        src="data:image/png;base64,"></Avatar>
                    <Typography variant="spam">John</Typography>
                </UserBox>
                <Menu
                    id="demo-positioned-menu"
                    aria-labelledby="demo-positioned-button"
                    open={true}
                    anchorOrigin={{
                        vertical: 'top',
                        horizontal: 'left',
                    }}
                    transformOrigin={{
                        vertical: 'top',
                        horizontal: 'left',
                    }}
                >
                    <MenuItem>Profile</MenuItem>
                    <MenuItem>My account</MenuItem>
                    <MenuItem>Logout</MenuItem>
                </Menu>

            </StyledToolbar>

        </AppBar>
    )
}

export default Navbar
